import React from "react";
import Tilt from 'react-parallax-tilt';

function Logo(){
    return(
     <div className="logo">
      <Tilt>
        <div style={{display : "inline-block"}}>
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRpuYzCbY0joMQdxjDKY1PqhD6Uml0Mh2o2lvTOZMMu8A&s" alt="" />
        </div>
      </Tilt>
     </div>
    )
}

export default Logo;
